import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Card } from "react-bootstrap";

function App() {
  return (
    <div className="App">
          <Container>
              <Card>
                <Card.Body>This is some text within a card body.</Card.Body>
              </Card>
          </Container>
    </div>
  );
}

export default App;
